pragma solidity >=0.8.0 <0.9.0;

contract Voting {
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    uint256 voteForTrump;
    uint256 voteForBiden;
    mapping(address => bool) alreadyVoted;

    modifier onlyOwner(){
    require(
        msg.sender == owner,
        "This function is restricted to the contract's owner"
    );
    _;
}

    function VoteForTrump() public returns (string memory) {
        require(alreadyVoted[msg.sender] == false, "You already Voted.");
        alreadyVoted[msg.sender] == true;
        voteForTrump++;
        return ("You Successfully Voted for Trump.");
    }

    function VoteForBiden() public returns (string memory) {
        require(alreadyVoted[msg.sender] == false, "You already Voted.");
        alreadyVoted[msg.sender] == true;
        voteForBiden++;
        return ("You Successfully Voted for Biden.");
    }

    function totalVote() public view returns (uint256) {
        return (voteForTrump + voteForBiden);
    }

    function selectWinner() public onlyOwner view returns (string memory) {
        if (voteForTrump == voteForBiden)
            return (
                "Elections Tie between Trump and Biden."
            );
        else if (voteForTrump > voteForBiden)
            return (
                "Trump is winner of Elections."
            );
        else
            return (
                "Biden is winner of Elections."
            );
    }
}
